import styles from '../components/Header.module.css';
import React from "react";

function Header(){
    return (
        <React.Fragment>
     <header className = {styles.header}>
         <h1 className = {styles.heding}>Today Tasks</h1>
         <TodayDate></TodayDate>
     </header>
     </React.Fragment>
    );
}

export default Header;
